import React, { useEffect, useState } from 'react'
import {Link} from 'react-router-dom'
import axios from 'axios';
import SignUpForm from '../components/SignUpForm';
import './style.css'
const SignUp = (props) =>{


    return(
        <div>
            <p className="goBack">
            <Link to="/">Go Back</Link>
            </p>
            {<SignUpForm/>}
        </div>
    )
}
export default SignUp
